import React, { useState, useEffect, useContext } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import "../styles/ProductList.css";
import AuthContext from "../AuthContext";

const ProductList = () => {
    const [products, setProducts] = useState([]);
    const [message, setMessage] = useState(""); 
    const { user } = useContext(AuthContext);
    const userId = user?.userId;
    const [userData, setUserData] = useState(null);
    const navigate = useNavigate();

    useEffect(() => {
        fetchUserData();
        fetchProducts();
    }, [userId]);

    // Fetch user details (Check membership status and supercoins balance)
    const fetchUserData = async () => {
        if (!userId) return;
        try {
            const response = await axios.get(`http://localhost:8080/api/users/${userId}`);
            console.log("User Data Response:", response.data); // Log user data response
            setUserData(response.data);
        } catch (error) {
            console.error("Error fetching user data:", error);
        }
    };

    // Fetch all products from the backend
    const fetchProducts = async () => {
        try {
            const response = await axios.get("http://localhost:8080/api/products");
            console.log("Products Response:", response.data); // Log products response
            setProducts(Array.isArray(response.data) ? response.data : []);
        } catch (error) {
            console.error("Error fetching products:", error);
            setProducts([]);
        }
    };

    // Calculate price with membership discount
    const getDiscountedPrice = (price) => {
        return userData?.member ? (price * 0.9).toFixed(2) : price.toFixed(2);
    };

    // Calculate remaining amount after using supercoins
    const calculateFinalPrice = (price, useSupercoins) => {
        if (!useSupercoins || !userData) return price;
        const supercoinsToUse = Math.min(userData.superCoins, price * 10);
        const discountAmount = supercoinsToUse / 10;
        return (price - discountAmount).toFixed(2);
    };

    return (
        <div className="product-container">
            <h2>Product List</h2>

            {message && <p className="alert-message">{message}</p>}

            <div className="product-grid">
                {products.length > 0 ? (
                    products.map((product, index) => {
                        console.log("Rendering Product:", product); // Log each product while rendering

                        const originalPrice = product.price;
                        const discountedPrice = getDiscountedPrice(originalPrice);
                        const canUseSupercoins = userData && userData.superCoins > 0;

                        return (
                            <div className="product-card" key={product.productId || index}>
                                <img
                                    src={product.productUrl || "https://via.placeholder.com/150"}
                                    alt={product.name || "Product Image"}
                                    className="product-image"
                                />
                                <div className="product-info">
                                    <h3>{product.name}</h3>
                                    <p className="product-description">{product.description}</p>

                                    {/* Show price with membership discount if applicable */}
                                    {userData?.member ? (
                                        <p className="product-price">
                                            <span className="original-price">â‚¹{originalPrice}</span> â‚¹{discountedPrice}
                                        </p>
                                    ) : (
                                        <p className="product-price">â‚¹{originalPrice}</p>
                                    )}

                                    {/* Checkbox for buying with supercoins */}
                                    {canUseSupercoins && (
                                        <div className="supercoins-option">
                                            <input
                                                type="checkbox"
                                                id={`supercoins-${product.productId}`}
                                                onChange={(e) => {
                                                    const useSupercoins = e.target.checked;
                                                    const finalPrice = calculateFinalPrice(discountedPrice, useSupercoins);
                                                    document.getElementById(`final-price-${product.productId}`).innerText = `Final Price: â‚¹${finalPrice}`;
                                                }}
                                            />
                                            <label htmlFor={`supercoins-${product.productId}`}>
                                                Use Supercoins (Available: {userData.superCoins})
                                            </label>
                                        </div>
                                    )}

                                    {/* Final Price after Supercoins deduction */}
                                    <p id={`final-price-${product.productId}`} className="final-price">Final Price: â‚¹{discountedPrice}</p>

                                    <div className="product-buttons">
                                        <button className="buy-now" onClick={() => navigate(`/product/${product.productId}`)}>
                                            Buy Now
                                        </button>
                                    </div>
                                </div>
                            </div>
                        );
                    })
                ) : (
                    <p className="no-products">No products found</p>
                )}
            </div>
        </div>
    );
};

export default ProductList;
